
<script>
  
  let certificate = {
    init: function(cfg,cb) {
        let self = this;
        
        // reset reference
      this.reference = {
        codes: [],
        signatures: [],
        matches: []
      };
      
        // save config in instance
      this.config = cfg;
      
        // dom manipulation
        this.config.node.innerHTML = this.markup();
        if(this.config.download) {
        this.config.node.innerHTML += this.download();
        this.config.node.querySelector('.c-download button').addEventListener('click',function(e) {
          self.config.download.event(self.config.node.querySelector('.certificate'));
        });
      }
  
        // reference data
        this.fetch.codes(cfg,function(r){
        if(!r)
          return cb(self.errors(0));
        if(r.length == 0)
          return cb(self.errors(1));
  
          // update reference
        self.reference.codes = r;
  
        self.fetch.signatures(cfg,function(r) {
          if(!r)
            return cb(self.errors(2));
          if(r.length == 0)
            return cb(self.errors(3));
          
            // update reference
            self.reference.signatures = r;
          
            // update dom
            self.populate();
          self.show();
  
            // callback
          cb(self.errors(99));
        });
      });
    },
      markup: function() {
      return this.html() + this.css();
    },
      html: function() {
      return `<div class="certificate c-hidden" data-type="vantage">
        <div class="c-wrapper">
          <div class="c-row c-logo mb-40">
            <div class="c-col"></div>
          </div>
  
          <div class="c-row c-name">
            <div class="c-col">
              <p class="c-ellipsis"></p>
            </div>
          </div>
  
          <div class="c-row c-location mb-20">
            <div class="c-col">
              <p class="c-ellipsis"></p>
            </div>
          </div>
  
          <div class="c-row c-description mb-40">
            <div class="c-col">
              <p>Qualifies as an <span class="c-program">...</span> partner for fiscal year <span class="c-year">...</span></p>
            </div>
          </div>
  
          <div class="c-row c-membership-header">
            <div class="c-col">
              <p></p>
            </div>
          </div>
  
          <div class="c-row c-membership-list mb-20">
            <div class="c-col">
              <ul>
              </ul>
            </div>
          </div>
  
          <div class="c-row c-signature">
  
          </div>
        </div>
      </div>`;
    },

      download: function() {
      return `<div class="c-download"><div class="c-row"><div class="c-col"><button>`+this.config.download.label+`</button></div></div></div>`;
    },
      populate: function() {
        let self = this;
      
        // header
      this.config.node.querySelector(".c-name p").innerText = this.config.partner;
        this.config.node.querySelector(".c-location p").innerText = this.config.location;
        this.config.node.querySelector(".c-program").innerText = this.config.program;
        this.config.node.querySelector(".c-year").innerText = this.config.year;
        
        // centers of expertise
        if(this.config.categories) {
        for(let i=0;i<this.config.categories.length;i++) {
          for(let j=0;j<this.reference.codes.length;j++) {
            if(this.config.categories[i].toLowerCase() == this.reference.codes[j].Code.toLowerCase()) {
              this.reference.matches.push(this.reference.codes[j].CertificateName);
              j = this.reference.codes.length;
            }
          }
        }
      }
        if(this.reference.matches.length > 0) {
          this.config.node.querySelector(".c-membership-header p").innerText = this.config.category;
          this.reference.matches.sort();
        for(let i=0;i<this.reference.matches.length;i++)
            this.config.node.querySelector(".c-membership-list ul").innerHTML += '<li class="c-ellipsis">'+this.reference.matches[i]+'</li>';
      }
  
        // signatures
        let signature = null;
        for(let i=0;i<this.reference.signatures.length;i++)
        if(this.reference.signatures[i].Country == this.config.country) {
          signature = this.reference.signatures[i];
            break;
        }
        if(signature == null) {
          for(let i=0;i<this.reference.signatures.length;i++)
          if(this.reference.signatures[i].Country == this.config.region) {
            signature = this.reference.signatures[i];
            break;
          }
      }
        if(signature != null) {
        // left
        if(signature.EGFirstSignatureName)
          self.config.node.querySelector(".c-signature").innerHTML += `<div class="c-col c-left sw-50">
            <img src="`+signature.EGFirstSignatureURL+`" class="c-signature"/>
            <p class="c-leader-name">`+signature.EGFirstSignatureName+`</p>
            <p class="c-leader-title">`+signature.EGFirstSignatureRole+`</p>
          </div>`;
        else if(signature.NTWKFirstSignatureName)
          self.config.node.querySelector(".c-signature").innerHTML += `<div class="c-col c-left sw-50">
            <img src="`+signature.NTWKFirstSignatureURL+`" class="c-signature"/>
            <p class="c-leader-name">`+signature.NTWKFirstSignatureName+`</p>
            <p class="c-leader-title">`+signature.NTWKFirstSignatureRole+`</p>
          </div>`;
        // right
        if(signature.EGSecondSignatureName)
          self.config.node.querySelector(".c-signature").innerHTML += `<div class="c-col c-right sw-50">
            <img src="`+signature.EGSecondSignatureURL+`" class="c-signature"/>
            <p class="c-leader-name">`+signature.EGSecondSignatureName+`</p>
            <p class="c-leader-title">`+signature.EGSecondSignatureRole+`</p>
          </div>`;
        else if(signature.NTWKSecondSignatureName)
          self.config.node.querySelector(".c-signature").innerHTML += `<div class="c-col c-right sw-50">
            <img src="`+signature.NTWKSecondSignatureURL+`" class="c-signature"/>
            <p class="c-leader-name">`+signature.NTWKSecondSignatureName+`</p>
            <p class="c-leader-title">`+signature.NTWKSecondSignatureRole+`</p>
          </div>`;
        this.config.node.querySelector(".c-signature").innerHTML += '<div class="c-clear"></div>';
      }
    },
      show: function() {
      this.config.node.querySelector(".certificate").classList.remove("c-hidden");
    },
      fetch: {
      codes: function(cfg,cb) {
        hpe.api.dataset({
          form: '1416',
          dataset: 'Program_Certificates',
          payload: {
            skip: '0',
            pageSize: '1000',
            take: '1000',
            filter: {
              logic: "and",
              filters: [
                {
                  field: "Type",
                  operator: "eq",
                  value: "Vantage"
                }
              ]
            }
          }
        },function(d) {
          if(!d || !d.Data)
            cb(false);
          else if(d.Data.length == 0)
            cb([]);
          else cb(d.Data);
        });
      },
      signatures: function(cfg,cb) {
        hpe.api.dataset({
          form: '1416',
          dataset: 'Program_Signatures',
          payload: {
            skip: '0',
            pageSize: '1000',
            take: '1000',
              filter: {
              logic: "or",
              filters: [
                {
                  field: "Country",
                  operator: "eq",
                  value: cfg.country
                },
                {
                  field: "Country",
                  operator: "eq",
                  value: cfg.region
                }
              ]
            }
          }
        },function(d) {
          if(!d || !d.Data)
            cb(false);
          else if(d.Data.length == 0)
            cb([]);
          else cb(d.Data);
        });
      }
    },
    reference: {
      codes: [],
      signatures: [],
        matches: []
    },
    errors: function(id) {
        let self = this;
      switch(id) {
          case 0: {
          return {
            id: id,
              message: 'Failed to retrieve certificate achievement code mapping',
            success: false,
              struct: self
          };
        }
        case 1: {
          return {
            id: id,
              message: 'No certificate achievement code mapping found',
            success: false,
              struct: self
          };
        }
        case 2: {
          return {
            id: id,
              message: 'Failed to retrieve certificate signature mapping',
            success: false,
              struct: self
          };
        }
          case 3: {
          return {
            id: id,
              message: 'No certificate signature found',
            success: false,
              struct: self
          };
        }
        case 99: {
          return {
            id: id,
            message: null,
            success: true,
            struct: self
          }
        }
      }
    }
  }
